// Filters.js
import React from 'react';
import './Filters.css'

function Filters() {
  return (
    <div className="filters">
      <select>
        <option>Filter 1</option>
      </select>
      <select>
        <option>Filter 2</option>
      </select>
      <select>
        <option>Filter 3</option>
      </select>
      <button>Apply</button>
    </div>
  );
}

export default Filters;
